css:
.nuclide-diagnostics-gutter-ui-gutter-error,
.nuclide-diagnostics-gutter-ui-gutter-warning {
  font-family: "Octicons Regular";
}
.nuclide-diagnostics-gutter-ui-gutter-error {
  color: #f42a2a;
}
.nuclide-diagnostics-gutter-ui-gutter-warning {
  color: #d5880b;
}
.nuclide-diagnostics-gutter-ui-popup {
  background: #ccdce0;
  box-shadow: 0px 1px 4px 0px #000000;
  position: absolute;
  padding-right: 10px;
  padding-left: 10px;
  z-index: 4;
}
.nuclide-diagnostics-gutter-ui-popup-header {
  display: flex;
  justify-content: space-between;
  margin-left: -10px;
  margin-right: -10px;
  padding: 4px 10px;
}
.nuclide-diagnostics-gutter-ui-popup-diagnostic {
  color: #273a3f;
  font-family: Menlo, Consolas, 'DejaVu Sans Mono', monospace;
}
.nuclide-diagnostics-gutter-ui-popup-error .nuclide-diagnostics-gutter-ui-popup-header {
  background-color: rgba(244, 42, 42, 0.2);
}
.nuclide-diagnostics-gutter-ui-popup-warning .nuclide-diagnostics-gutter-ui-popup-header {
  background-color: rgba(213, 136, 11, 0.2);
}
.nuclide-diagnostics-gutter-ui-popup-message {
  padding-top: 4px;
  padding-bottom: 4px;
}
